package com.company;import java.util.Scanner;public class CharactersInRange_03 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        char input1 = scanner.nextLine().charAt(0);        char input2 = scanner.nextLine().charAt(0);        charactersInRange(input1, input2);    }    public static void charactersInRange(char a, char b) {        if (b < a) {            char currentSymbol = a;            a = b;            b = currentSymbol;        }        for (char i = a; i < b; i++) {            if (i == a) {                continue;            }            System.out.print(i + " ");        }    }}